import React, { useState } from 'react';
import { db } from '../firebase/firebaseConfig';
import { collection, addDoc } from 'firebase/firestore';

const SurveyForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    instagram: '',
    area: '',
    frequency: [],
    shopFor: [],
    deliveryApp: '',
    favoriteStore: '',
    contact: ''
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (type === 'checkbox' && name === 'frequency') {
      setFormData((prev) => ({
        ...prev,
        frequency: checked
          ? [...prev.frequency, value]
          : prev.frequency.filter((item) => item !== value)
      }));
    } else if (type === 'checkbox' && name === 'shopFor') {
      setFormData((prev) => ({
        ...prev,
        shopFor: checked
          ? [...prev.shopFor, value]
          : prev.shopFor.filter((item) => item !== value)
      }));
    } else {
      setFormData((prev) => ({ ...prev, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      await addDoc(collection(db, 'surveyResponses'), formData);
      alert('Survey submitted successfully!');
      setFormData({
        name: '',
        instagram: '',
        area: '',
        frequency: [],
        shopFor: [],
        deliveryApp: '',
        favoriteStore: '',
        contact: ''
      });
    } catch (error) {
      console.error('Error submitting survey:', error);
      alert('Something went wrong. Please try again.');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>FlashFit Survey Form</h2>

      <label>
        1. What is your name?
        <input type="text" name="name" value={formData.name} onChange={handleChange} required />
      </label>

      <label>
        2. What's your Instagram handle? (optional)
        <input type="text" name="instagram" value={formData.instagram} onChange={handleChange} />
      </label>

      <label>
        3. Which area of Hyderabad are you in?
        <select name="area" value={formData.area} onChange={handleChange} required>
          <option value="">-- Select --</option>
          <option value="Gachibowli">Gachibowli</option>
          <option value="Kukatpally">Kukatpally</option>
          <option value="Jubilee Hills">Jubilee Hills</option>
          <option value="Madhapur">Madhapur</option>
          <option value="Other">Other</option>
        </select>
      </label>

      <fieldset>
        <legend>4. How often do you buy clothes online?</legend>
        <label><input type="checkbox" name="frequency" value="once a week" onChange={handleChange} /> Once a week</label>
        <label><input type="checkbox" name="frequency" value="twice a month" onChange={handleChange} /> Twice a month</label>
        <label><input type="checkbox" name="frequency" value="only when needed" onChange={handleChange} /> Only when needed</label>
        <label><input type="checkbox" name="frequency" value="rarely" onChange={handleChange} /> Rarely</label>
      </fieldset>

      <fieldset>
        <legend>5. What do you shop for the most?</legend>
        <label><input type="checkbox" name="shopFor" value="T-shirts" onChange={handleChange} /> T-shirts</label>
        <label><input type="checkbox" name="shopFor" value="Shirts" onChange={handleChange} /> Shirts</label>
        <label><input type="checkbox" name="shopFor" value="Dresses" onChange={handleChange} /> Dresses</label>
        <label><input type="checkbox" name="shopFor" value="Ethnic Wear" onChange={handleChange} /> Ethnic Wear</label>
        <label><input type="checkbox" name="shopFor" value="Bottoms" onChange={handleChange} /> Bottoms</label>
        <label><input type="checkbox" name="shopFor" value="Accessories" onChange={handleChange} /> Accessories</label>
      </fieldset>

      <label>
        6. Would you use a 30-minute fashion delivery app?
        <select name="deliveryApp" value={formData.deliveryApp} onChange={handleChange} required>
          <option value="">-- Select --</option>
          <option value="yes">Yes</option>
          <option value="no">No</option>
        </select>
      </label>

      <label>
        7. Any store or brand you would love to see on FlashFit? (optional)
        <input type="text" name="favoriteStore" value={formData.favoriteStore} onChange={handleChange} />
      </label>

      <label>
        8. Phone or Email for early access:
        <input type="text" name="contact" value={formData.contact} onChange={handleChange} required />
      </label>

      <button type="submit">Submit</button>
    </form>
  );
};

export default SurveyForm;
